import { NavLink, Route, Routes } from "react-router-dom";
import Create from './Create'
import Myvotes from "./Myvotes"
export default function Main(){
  //2选一不会有冲突，所以省去了Routes
  return(
    <div>
      <Routes>

      <Route path="/main/create" element={Create}></Route>
      <Route path="/mian/myvotes" element={Myvotes}></Route>

      </Routes>

      <nav>
        <NavLink to="main/create">新建</NavLink>
        {'|'}
        <NavLink to="mian/myvotes">我的</NavLink>
      </nav>
    </div>
  )
}
